const Commits = () => {


    function commits(username,repo){


        const xhr = new XMLHttpRequest();


        const url = `https://api.github.com/users/${username}/${repo}/commits`;



        xhr.open('GET', url, true);


        xhr.onload = function () {


          const commits = JSON.parse(this.response);


            for (let i in commits) {


                console.log(commits[i]);

              }

            }




        xhr.send();

          }


  return (
    <div>
        <button onClic></button>Commits</div>

  )
}

